def score(s, j):
    if (s == 'G' and j == 'C') or (s == 'C' and j == 'G'):
        return 0
    if s == j:
        return 1
    else:
        return -1

def NeedlemanWonch(s, t):
    m = len(s) + 1
    n = len(t) + 1
    opt = [[0 for col in range(m)] for row in range(n)]
    for i in range(m):
        opt[0][i] = -3 * i
    for j in range(n):
        opt[j][0] = -3 * j
    for j in range(1, m):
        for i in range(1, n):
            temp = -1
            opt[i][j] = max(opt[i-1][j-1] + score(t[i-1], s[j-1]), opt[i-1][j] - 3, opt[i][j-1] -3)
    return opt[n-1][m-1]

